Half-Track: A History of American Semi-Tracked Vehicles
by R.P.Hunnicutt

DESCRIPTION:
A complete history of American semi-track vehicles for both military and rural uses. Includes numerous black and white photographs, diagrams and other aids. Also includes detailed explanations of each vehicle, including its use, the dates of its invention and use, and its mechanical workings, from fuel to horsepower.

